    a {

      color: white;
      line-height: 100px;
      width: 200px;
      height: 100px;
      font-size: 20px;
      margin: 5px;
      text-decoration: none;
    }

    .red {
      background: red
    }

    .blue {
      background: blue
    }

    .green {
      background: green
    }

    .special {
      background: #F09819;
      /* fallback for old browsers */
      background: -webkit-linear-gradient(to right, #EDDE5D, #F09819);
      /* Chrome 10-25, Safari 5.1-6 */

      /* W3C, IE 10+/ Edge, Firefox 16+, Chrome 26+, Opera 12+, Safari 7+ */

    }
